import { MyContext } from "../MyContext";

export default function TestResults() {
  return (
    <MyContext.Consumer>
      {({ course, media }) => {
        return (
          <p>
            {course}
            {media}
          </p>
        );
      }}
    </MyContext.Consumer>
  );
}
